window.bookSummaryJSON = "<p><b>The inspiration for NOT DEAD YET, ABC’s “Most Watched Comedy Debut in More Than Four Years” (</b><b><i>Deadline</i></b><b>)</b></p> <p><b>“The new Bridget Jones for our time.”—</b><b><i>Telegraph</i></b></p> <p><b>“Will have you laughing whether you’re twenty, forty, or eighty.”—</b><b><i>Heat </i></b><b>(UK)</b></p> <p><b>A Zibby Magazine Top 10 Book of the Year</b></p> <p><b>A funny and heartfelt novel for any woman who wonders</b> <b>how the hell she got here and why life isn't quite how she imagined it was going to be.</b></p> <p>Meet Nell. Her life is a mess.</p> <p>When her business goes bust and her fiancé with it, Nell's happy ever after in California falls apart and she moves back to London to start over. But a lot has changed since she’s been gone. All her single friends are now married with children, a sky-high real estate market forces her to rent a room in a stranger’s house, and everyone has seemingly perfect Instagram-ready lives. Starting from scratch she feels like a f**k up . . . <i>a forty-something f**k up</i>.</p> <p>Landing a job writing obituaries, Nell meets the fabulous Cricket, an 80-something widow with challenges of her own. Together they begin to help each other heal their aching hearts, cope with the loss of the lives they had planned, and push each other into new adventures and joy. With Cricket’s help, Nell is determined to turn her life around. First, though, she has a confession . . .</p> <p>Laugh-out-loud funny and painfully relatable, <i>Confessions of a Forty-Something F**k Up </i>is a celebration of friendship and a reminder that while life doesn’t always go according to plan, it doesn’t mean you can’t find happiness.</p>"; 
